import React, {Component} from "react";
import {DataGrid} from '@material-ui/data-grid';


export class BooklistComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            booklist: []
        }
    }

    render() {
        return (
            <div className="row">
                <table className="table table-striped table-bordered">
                    <thead>
                    <tr>
                        <th>Изображение</th>
                        <th>Название</th>
                        <th>Год выпуска</th>
                        <th>Описание</th>
                        <th>Действие</th>
                    </tr>
                    </thead>
                    <tbody>
                    {
                        this.state.booklist.map(
                            book =>
                                <tr key={book.id}>
                                    <td>{book.link}</td>
                                    <td>{book.title}</td>
                                    <td>{book.year}</td>
                                    <td>{book.review}</td>
                                </tr>
                        )
                    }
                    </tbody>
                </table>
            </div>
        )
    }
}
